import React from "react";
import Header from "../Components/header";
import Button from '@material-ui/core/Button';
import { Link } from "react-router-dom";
const Splash = function(){
function ButtonClicked(event){
    // event.preventDefault();
}
function handleSignin(event){
    event.preventDefault();
}

    return <div>
        <Header></Header>
        <div className="buttons">
        <form onSubmit={handleSignin}>
            <input name="email" type="email" placeholder="Enter your Email"></input>
            <input name="password" type="password" placeholder="Enter your Password"></input>
            <button type="submit" >Sign Up</button>
        </form>
        <Link to="/signin"><Button children="Sign in" size="large" variant="contained"></Button></Link><br></br>
        <Link to="/signup"><Button children="Sign up" size="large" variant="contained" onClick={ButtonClicked}></Button></Link>
        </div>
    </div>
}
export default Splash;
